                        "text": "LA JOLLA, Calif. - Sept. 14, 2016 - PRLog -- San Diego's internationally recognized San Diego Jewish Book Fair celebrates its 22nd year with an intriguing mix of more than 30 leading authors in their fields including: Jennifer Weiner, Rich Cohen, Shep Gordon, Samuel M. Katz, Todd Buchholz, Dov Waxman, Daniel Oppenheimer, Nina Tassler, Peter Himmelman and Fred Kaplan. This year's lineup strikes a balance of arts and intellect, ideas and imagination, history and humor, and also will include spirited discussions about cyber wars, politics, the economy and the military. ...",
